import React, {useEffect, useState} from 'react';
import {fetchAllList} from "../http/listAPI";

const Full = () => {
    const [fullList,setFullList]=useState('')
    useEffect(()=>{
        fetchAllList().then(data=> setFullList(data))
    },[])

    console.log(fullList)
    return (
        <div>
               Список всего
        </div>
    );
};

export default Full;
